import React from "react";
import SearchBar from "./SearchBar";
import { Link } from "react-router-dom";


export default function Nav({onSearch}) {
    return (
      <div>
         <Link to='/'>
          <span  >
             Rick and Morty
          </span><br></br>
          </Link>

          <SearchBar onSearch={onSearch}/>

      </div>
    )
  }
